import React from 'react';
import './Header.css'; 
import Nav from './Nav';

const Header = ({onRouteChange, isSignedIn}) => {
	return (
		<header className='background-image-container'>
			<div>
				<h1>Event Finder</h1>
				<p> Planning a trip? Here you'll find all the events happening during</p>
			</div>
			<Nav onRouteChange={onRouteChange} isSignedIn={isSignedIn}/>
	    </header>
	);
}

export default Header;
